import React, { useState } from 'react'

const About = () => {
  return (
      <section className="section about-section">
      <h1 className="section-title">About us</h1>
      <p>NFT Finder è una piattaforma realizzata da David Azzato. 
        Il progetto è parte del lavoro di tesi per la laurea magistrale in Ingengeria Informatica,
        presso l'Università della Calabria.
        I relatori di tesi sono: il Professore Andrea Tagarelli e il Professore Lucio La Cava.</p>
    </section>
  )
}
export default About
